
class Solution:
    def longestPalindromeSubseq(self, s: str) -> int:
        #dp[i][j] is denot that s[i:j] is palindrone or not
        #dp[i][j] is palindrome if dp[i + 1][j - 1] is true and s[i] = s[j]
        n = len(s)
        dp = [[0] * n for i in range(n)]

        for i in range(n):
            dp[i][i] = 1

        for l in range(1, n):       #all possible len
            for i in range(n - l):
                j = i + l
                if s[i] == s[j]:
                    dp[i][j]  = dp[i + 1][j - 1] + 2
                else:
                    dp[i][j] = max(dp[i + 1][j], dp[i][j - 1])
        return dp[0][n - 1]
s = ""
print(Solution().longestPalindromeSubseq(s))